import './App.css';
import bg from "./assets/bg-web.png"
import logo from "./assets/logo.png"
import {Button} from "@mui/material"

function App() {

  const styles = {
    container: {
      display: "flex",
      flexDirection: "column",
      flex: 1, 
      padding: "10em"
    },
    title: {
      color: "#FFF"
    },
    panel: {
      display: "flex",
      flex: 1,
      backgroundColor: "#FFF"
    }
  }

  return (
    <div className="App" style={{display: "flex", backgroundImage: `url(${bg})`, backgroundSize: "cover", minHeight: "100vh" }}>
      <div style={styles.container}>
        <div className="header" style={{display: 'flex', alignItems: "center", justifyContent: "space-between"}}>
          <div className="title" style={{display: 'flex', alignItems: "flex-end"}}>
            <h1 style={styles.title}>FlyFair</h1>
            <img src={logo} height={100}/>
          </div>
          <Button variant="contained">+ Add Flight</Button>
        </div>
        <div style={{display: "flex", flex: 1, backgroundColor: "#FFF"}}>
          <div style={{...styles.panel}}></div>
          <div style={{...styles.panel}}></div>
        </div>
      </div>
    </div>
  );
}

export default App;
